import React from "react";
import "../stylesheets/CharacterDetail.scss";

class CharacterDetail extends React.Component {
  constructor(props) {
    console.log(props.nameddtail);
    super(props);
  }
  render() {
    return (
      <article className={`cardDetail ${this.props.id}`}>
        <h2>{this.props.namedetail}</h2>
        <img src={this.props.imagedetail} alt={this.props.imagedetail}></img>
        <p>{this.props.speciesdetail}</p>
        <p>{this.props.origindetail}</p>
      </article>
    );
  }
}

CharacterDetail.defaultProps = {};
export default CharacterDetail;
